Green Paradise

Nature, Travel Documentary hosted by Peter Hudson, published by Questar in 2011 - English narration


Information
------------------------------

Green Paradise
Explore the world's most beautiful paradises! The natural beauty of these stunning locales has been preserved for centuries by local populations. Travel to these magical places and experience their splendours in stunning high definition. Learn about local wildlife and regional ecosystems. Meet the locals whose dedication has preserved these lands, and who are now building their economies through sustainable eco-tourism. Filled with unforgettable imagery, Green Paradise tells the stories of the most gorgeous natural places on Earth!




10)  Madagascar 
Today, Madagascar has opened up and is finally showing itself to visitors, revealing the extent of its incredible natural and human resources.


